- input: "TEXT\x1CC00089243\x1C.TEXT\x1C\x1CF3XA\x1CThis report includes Memo Schedule
    entries for contributions raised by the DNC-MA Party Victory Fund.  The committee
    may or may not have received its share of the proceeds as of the end of the reporting
    period.  The committee expects to receive transfers at some point in the three
    months following this reporting period.  Best Efforts:  A request is made of each
    contributor for employer and occupation information with an initial solicitation
    in the form of a uniform reply card requesting the necessary information.  In
    the event the contributor fails to comply, they receive a follow up letter within
    30 days of the contribution requesting the information and providing the contributor
    with several methods (e.g. telephone, e-mail, fax, return envelope) to supply
    the necessary information.  In addition, staff queries the event host, online
    databases and other sources of employer and occupation information in order to
    determine the information.  If the information is still unavailable, the campaign
    deems that it has used its best efforts to comply with the regulations in this
    area.  Reports are amended as additional contributors provide their employer and
    occupation information.\n"
